import AddTask from "./AddTask";
import React ,{useState} from "react";

export default function ToDoData({text}){
    const[addTask,setAddTask] = useState('');
    let Id =0;

    function handleAddTask(text){
          Id++;
        setAddTask([
          ...addTask,
        {

        id: Id,
        text: text,
        done: false,
        }
       ])
    }
   return(
    <>
    <AddTask onAddTask = {handleAddTask} />
    </>
   )
}
